import actionCreatorFactory from "typescript-fsa";

const actionCreator = actionCreatorFactory();

export type UserStateType = {
  readonly loading: boolean;
};


export type GetUserDonePayload = {
  loading: boolean;
};

export const triggerGetUser = actionCreator(
  "project/TRIGGER_GET_USER"
);

export const getUser = actionCreator.async("project/GET_USER");

export const triggerGetUsers = actionCreator(
  "project/TRIGGER_GET_USERS"
);

export const getUsers = actionCreator.async("project/GET_USERS");
